三、const  和  finial 的区别

const 只能被设一次值，在声明处赋值，且值必须为编译时常量；用于修饰常量。
final 只能被设一次值，在声明处赋值，值和普通变量的设值一样，可以是对象、字符串、数字等，用于修饰值的表达式不变的变量

