  List常用属性以及方法


一、List常用属性

通过[] 来访问List中的每一个元素void main() {
 List l = ['a','b','c'];
 print( l[0] ); // 'a'
}


List 通过length属性来获得长度void main() {
 List l = ['a','b','c'];
 print( l.length ); // 3
}


List通过isEmpty或是isNotEmpty来判断一个List是否为空void main() {
 List l = ['a','b','c'];
 print( l.isEmpty() );  //false
 print( l.isNotEmpty() );  //true
}


翻转数组void main() {
 List l = ['a','b','c'];
 var newList = l.revsered; // ('c','b','a')  
 /* 如果你想将newList转换成List类型，那么可以使用toList方法 */
 print( newList.toList() );// ['c','b','a']
}



二、List常用方法
添加

add void main() {
   List list = [ 1,2,3,4 ];
   list.add( '我是西阁' );// 添加单个元素 ,不能添加多个
   print( list ); // [ 1,2,3,4,'我是西阁' ]
 }


addAll void main() {
   List list = [ 1,2,3,4 ];
   list.addAll( [5,6] );// 拼接数组
   print( list ); // [ 1,2,3,4,5,6 ]
 }



删除

remove... void mian() {
   List list = ['🐻','⚽','🎂','🏈','abc','abcd'];
   //删除指定元素
   list.remove("🏈");
   print(list);
   //删除最后一个元素
   list.removeLast();
   print(list);
   //删除指定位置的元素
   list.removeAt(list.length - 1);
   print(list);
   //删除指定区域的元素
   list.removeRange(0,1);
   print(list);
   //下面这个方法是将列表List中的toString之后的字符串的长度等于3的元素全部删除
   list.removeWhere((item) => item.toString().length == 3);
   print("删除列表中toString后长度为3的元素：==> $list");
 }



